const PowerstatsContainer = ({stats}) => {
  console.log(stats)

  const statNames = Object.keys(stats)

  return (
    <div>
      {Object.keys(stats).map((key, index) => 
        (
        <PowerBar name={statNames[index]} 
                    percent={stats[key]}
                    key={Math.random()}
                    width={500}
                    />
        ))}
        
    </div>
  )
}

export default PowerstatsContainer
